import React from "react";
import {
  Nav,
  Navbar,
  NavDropdown,
  Button,
  Form,
  FormControl
} from "react-bootstrap";

class Header extends React.Component {
  render() {
    return (
      <nav className="navbar-header navbar-inverse navbar-fixed-top">
        <div class="container-fluid" />
      </nav>
    );
  }
}

export default Header;
